import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
      <div className="align-center">
        <h2 className="text-center">Chào mừng bạn đến với cửa hàng mua bán</h2>
        <img src="link-to-your-image" alt="Welcome Image" className="welcome-image" />
      </div>
    );
  }
}

export default Home;
